('196144086', 'اوتوبارك . . . . من المالك الاول ليك\nشيفروليه كابتيفا ( 7 راكب ) اعلي فئه\nموديل 2020\n عداد 61000 كم فقط\nفابريكه بالكامل\nرخصة باسم المالك مباشرا \nالمواصفات الفنيه:\nموتور1500تيربو  - 148 حصان - ناقل حركه اوتوماتيك cvt  يعمل في خمس أوضاع مختلفة وهم D وهو النظام العادي، وS وهو الوضع الرياضي، وECO وهو الوضع الاقتصادي لاستهلاك الوقود وSnow وهو الوضع الخاص بالجليد والوضع اليدوي بنحو 8 سرعات - متوسط استهلاك الوقود 9.8 لتر لكل ١٠٠ كم \nالكماليات: \n مفتاح بصمة start engine  - بصمة خارجية لفتح و غلق السيارة بدون مفتاح  - كاسيت شاشه 8 بوصة تاتش يدعم car play و اندرويد و مزود ب(USB - AUX - bluetooth - كاميرا خلفية -زجاج كهربائي - كمبيوتر رحلات - مثبت سرعة - محدد سرعة - طاره مالتي فانكشن - طاره متحركة متعددة الاوضاع - جنوط اسبور - اضاءات ليدات - فرش جلد - اشارات في المرايات - مراية معتمة - فتحت سقف- حساسات ركن امامية و خلفية - مخدع خلفي + حامل اكواب امامي و خلفي - ريموت - فوانيس ضباب - مرايات ضم كهرباء - التحكم في الكراسي كهرباء - سبويلر خلفي - شاشة بيانات للسائق ملونة بمقاس 7 بوصة - فرامل يد إلكترونية + AVH - نظام عرض ضغط الإطارات - مقابض أبواب من الكروم - منافذ USB أمامية وخلفية - ضبط مستوى الإضاءة الأمامية - قضبان في السقف ومساحة في الزجاج الخلفي - عدد 6 سماعات\nتجهيزات السلامة والأمان: \nانظمه AIRBAG لكل من السائق و الراكب الامامي و 2 جانبية \nفرامل مانعة لاانزلاق (ABS)\nنظام توزيع الكتروني لقوة الفرامل (EBD)\nنظام تحكم إلكتروني في الثبات ESC\nنظام تثبيت مقاعد الاطقال (Isofix)\nنظام التحكم في الجر TCS\nمساعد هايدروليك في المكابح HBA\nمساعد الصعود في المطالع HSA\nالسعر : 690.000 جنيه \n كما يتوفر لدينا انظمه تقسيط متعدده تناسب جميع الفئات ( بنوك - شركات تمويل - مباشر )  \nبمده تقسيط تصل إلى ٦٠ شهر \nاتصل بينا واعرف نظام التقسيط اللي يناسبك \n و ممكن تبدل عربيتك القديمه بعربيه جديده و تقسط الفرق \nملحوظه هامه : اطلب تطلع علي كل مستندات السياره و الفحص الفني لحاله السياره قبل ماتدفع أي أموال أو حتي قبل ما تقوم بفحصها بمعرفتك\nجميع السيارات المعروضه تم التحقق من سلامه ملكيتها لملاكها وتم عمل فحص فني باحدث الاجهزه علي يد متخصصين بخبره أكثر من ١٠ سنوات في فحص