('196486142', 'عداد العربيه ٦٣ الف كم \nفبريكا بالكامل بره و جوه\n بدهان المصنع حالة ممتازة'),
('196486295', 'استورد عربيتك بنفسك\nمع غندور اوتو\nزيرو جمارك\nاستلام بعد 60 يوم\n\nكلمنا لمزيد من التفاصيل\n01102005922\n01066600570\n01281743024\n01120993888\n01018721188\n01033211066\n01015998071\n01092492111\n01092467222\n\nنستورد السيارات  الاوروبيه بنزين/هايبرد/كهربا الى مصر زيرو جمارك حسب الطلب. \n\nزورو موقعنا\nwww. Ghandourauto. com \n\nنقوم باستخراج شهادة اليورو وان وتصدير السيارة من اوروبا مع مراعاة جميع اجراءات الشحن والتخليص والتأمين حتى تسليم السيارة من مكتبنا 279 ش. التسعين الجنوبي التجمع الخامس.'),
('196486307', 'فبريكا ما عدا جنب يمين و كبوت و رفرف امامى شمال\nملحوظة\n(يوجد تريحه خفيفه خلف الفانوس امامى شمال و تم معالجتها)'),
('196486329', 'استورد عربيتك بنفسك\nمع غندور اوتو\nزيرو جمارك\nاستلام بعد 60 يوم\n\nكلمنا لمزيد من التفاصيل\n01102005922\n01066600570\n01281743024\n01120993888\n01018721188\n01033211066\n01015998071\n01092492111\n01092467222\n\nنستورد السيارات  الاوروبيه بنزين/هايبرد/كهربا الى مصر زيرو جمارك حسب الطلب. \n\nزورو موقعنا\nwww. Ghandourauto. com \n\nنقوم باستخراج شهادة اليورو وان وتصدير السيارة من اوروبا مع مراعاة جميع اجراءات الشحن والتخليص والتأمين حتى تسليم السيارة من مكتبنا 279 ش. التسعين الجنوبي التجمع الخامس.'),
('196486509', '‏العربية فبريكا بره وجوه بحالة جيدة جدا'),
('196486542', 'السياره بحاله ممتازه فابريكه من الخارج والداخل كامله اعلي فئه بصمه وبانوراما كراسي سخانات جنط لونين رخصه ساريه تاني مالك صيانات كامله كاوتش جديد صالون بحاله ممتازه ولا تحتاج لأي مصاريف'),
('196486825', 'اوتوبارك . . . . من المالك الاول ليك\nبيجو 3008\nموديل 2013\n عداد 140,000 كم \nفبريكا بالكامل\nرخصة باسم المالك مباشرا \nالمواصفات الفنيه:\nموتور 1600  - 156 حصان - ناقل حركه اوتوماتيك - متوسط استهلاك الوقود 7.8 لتر لكل ١٠٠ كم  \nالكماليات: \nتكيف -قفل مركزي - زجاج كهربائي - مرايات ضم كهرباء  - جنوط اسبور - طارة مالتي فانكشن - مثبت سرعة - محدد سرعة - كاست مزودة ب(USB - AUX - bluetooth) - كمبيوتر رحلات - كمبيوتر اعطال - فرامل يد كهرباء - مرايه داخليه بخاصيه التعتيم الذاتي - مسند يد امامي - فامية للابواب الخلفية - سماعات بالابواب - التحكم في ارتفاع كرسي السائق - طارة متحركة متعددة الاوضاع - كاميرة خلفية - مساحات تخزين في الابواب - مصابيح ضباب - مصابيع امامية - \nتجهيزات السلامة والأمان:\nانظمه AIRBAG لكل من السائق و الركاب \nانظمه الفرامل ABS - EBD - ESP\nبرنامج تدعيم الفرامل\nالسعر : 395000 جنيه \n كما يتوفر لدينا انظمه تقسيط متعدده تناسب جميع الفئات ( بنوك - شركات تمويل - مباشر )  \nبمده تقسيط تصل إلى ٦٠ شهر \nاتصل بينا واعرف نظام التقسيط اللي يناسبك \n و ممكن تبدل عربيتك القديمه بعربيه جديده و تقسط الفرق \nملحوظه هامه : اطلب تطلع علي كل مستندات السياره و الفحص الفني لحاله السياره قبل ماتدفع أي أموال أو حتي قبل ما تقوم بفحصها بمعرفتك\nجميع السيارات المعروضه تم التحقق من سلامه ملكيتها لملاكها وتم عمل فحص فني باحدث الاجهزه علي يد متخصصين بخبره أكثر من ١٠ سنوات في فحص السيارات'),
('196487091', 'سياره MG 5 \nموديل 2020 \nعداد ٢٢٠٠٠ كم تقريبا\nتم عمل صيانه ال ١٠ الاف\nالمواصفات الفنيه:\nموتور 1500 سي سي - 120 حصان - ناقل حركه CVT - متوسط استهلاك الوقود 7.1 لتر لكل ١٠٠ كم \nالكماليات : \nتكييف تاتش - عدد المقاعد 5 - صالون جلد - كاسيت شاشه تاتش يدعم car play و اندرويد و مزود ب(USB - AUX - bluetooth - سنتر لوك - زجاج كهربائي - مفتاح بصمه start engine - مثبت سرعه - محدد سرعه - طاره مالتي - كمبيوتر رحلات - طاره متحركه متعدده الأوضاع - جنط سبور - مرايه داخليه بخاصيه التعتيم الذاتى - مصابيح اماميه وخلفيه ليد – فتحة سقف – كراسي كهرباء – USB خلفي – مرايات ضم كهربائي + اشارات – كاميرا 360 درجة – باور حساس – حساسات خلفية – 6 سماعات بالابواب – سخانات فى الكراسي الأمامية – فرامل يد كهرباء – حساسات للإضاءة – ليدات أمامية و خلفية – بصمة خارجية لفتح و غلق السيارة بدون مفتاح \nتجهيزات السلامة والأمان:\n6 airbags\nأنظمة مراقبة الاطارات\nحساسات ركن خلفية\nانظمه الفرامل ABS - EBD - ESP\nالسياره تدعم ISOFIX لتثبيت مقاعد الأطفال'),
('196487099', 'السياره بحاله ممتازه فابريكه دواخل بالكامل ورشه بالخارج حزام نظافه فقط نتيجه خرابيش وبهتان اللون كامله اعلي فئه رخصه ساريه تاني مالك صيانات كامله كاوتش جديد صالون بحاله ممتازه ولا تحتاج لأي مصاريف'),
('196487165', 'موديل ٢٠١٩ بدون جرام بوية عداد ٣٨٦٥٠ كيلو مالك اول صيانات كلها في التوكيل تم عمل صيانة ٤٠ الف قبل ميعادها \nعلي عداد ٣٧٠٠٠ كم\n\nمطلوب : ١٨٨٠٠٠٠\n\nMercedes C180 Avantgarde mint condition without paint 38650 kilometers. \nFirst owner, All services done in Mercedes-Benz service center. \n\nAsking price: 1.880000'),
('196487234', 'فرصة iiiiiاوتوماتك وارد الامارات اول ترخيص فابريقة بالكامل عداد٩٧الف كم صيانات وكاوتش جديد رخصة سنة ونصف جميع الكماليات جنوط 5ايرباج 2absوبلوتوث اعلي فئه بدون خربوش بالكتالوجات ومفتاح اسبير ولله المستعان وكل عام وانتم بخير ورمضان كريم'),
('196487302', 'اعلي فئه فبريكا بالكامل'),
('196487532', '95,000 km\nall fabrik\nall features except start engine & abs\nالتجار يمتنعون\nالبعيع بعقد مسجل'),
('196487673', 'العربية اعلي فئه بصمه بحاله جيده جدا بدون اي خرابيش فابريكه بالكامل بدون اي رش نهائي 170 الف كم تم عمل جميع الصيانات وتغير زيت الموتور وتغير ميجاترونك رخصة سنه ونص باسمي السيارة لا تحتاج لأي مصاريف'),
('196487731', 'لهواة الحالات النادرة والشاذة وكسر الزبرو للبيع سيارة مرسيدس E200 موديل 2020 وكيل كسر زيرو فابريكة بالكامل افنجراد استعمال راقي جدااا'),
('196487835', 'فيات جراند بونتو موديل ٢٠١٣ بحاله ممتازه لا تحتاج اي مصاريف جميع الكماليات مانوال رخصه باسمي مرور مدينة نصر'),
('196487903', 'HYUNDAI ELANTRA CN7 high Line - MODEL 2021 - 4th CATEGORY ONLY 30,000 KM LIKE ZERO\n\nنوع السياره : هيونداي إلنترا CN7 . \n\nلون السياره : ابيض . \n\nموديل : 2021 . \n\nفئه السياره : الفئه الرابعه هاي لاين . \n\nعداد : ٣٠،٠٠٠ كم . \n\nالكماليات :\nجنوط اسبور اسود \nفتحه سقف\nحساسات نور و مطر و بارك\nفوانيس ليدات خلفي و امامي \nشاشه تاتش سكرين \nكاميرا خلفيه\nبلوتوث\nايرباجات\nفارامل ABS و EBD\nمانع تزحلق \nسبويلر خلفي\nحساسات خلفيه \nدرايڤ مود\nفرش جلد فاخر نبيتي\nمساند و مخادع و حوامل اكواب و اباچورات و جراب نظاره\nمرايات ضم\nاشارات مرايات\nطاره جلد \nكاميرا خلفيه \nمثبت سرعه\nطاره مالتي فانكشن \n\nطريقه الدفع : نقداً و يوجد ايضاً امكانيه التقسيط \n\nالمقدم يبدأ من ٣٠ ٪؜ ، مده التقسيط من سنه الي ٥ سنوات و يوجد ايضاً حتي ٧ سنوات في حاله الرغبه \nالتقسيط عن طريق البنوك و شركات التمويل و يوجد ايضاً تقسيط مباشر في حاله الرغبه \n\nالمطلوب للموظفين : صوره البطاقه و بيانات العمل \nالمطلوب لآصحاب العمل : صوره البطاقه و صوره السجل التجاري و صوره البطاقه الضريبيه\nاسأل عن التقسيط عند زياره المعرض\n\nحالة السياره :  السياره بحاله الزيرو تماماً بحاله شاذه فقط ٣٠،٠٠٠ كم  لا يوجد بها خربوش\nصيانات كامله  برجاء الاتصال للجادين فقط ( من الساعه الواحده ظهرا و حتي العاشره مساء - \n\nالمعاينه بمدينه نصر \n٢٤ ب شارع انور المفتي خلف طيبه مول . \n\n \n\n \n\n\n-01008886441 -\n01000507444 -\n01282303333-\n\n‏‎ ٢٤ ب شارع الدكتور أنور المفتي خلف طيبه مول بمدينة نصر. \n\n\n\n‏');

