('162763454', 'مطلوب للشراء X5 X6 لها حادث او عطل'),
('178709747', 'السيارة بحاله ممتازة صيانه دوريه في التوكيل الفواتير متاحه للأطلاع \nالبيع بعقد مسجل\nسوداء فرش أسود دواخل فابريقه \nفضلا الوسطاء يمتنعون'),
('179829042', 'للبيع فورد فيوجن ٢٠١٨ تيتانيوم \nعداد: ٨٠،٠٠٠ كم\nاللون: فيراني\nحالة الدهان: فابريكا بالكامل\nجميع الصيانات بالتوكيل \nالإمكانيات: جنوط كوجا تيتانيوم - تكييف ديوال زون - تكييف خلفي - فتحة سقف -  كراسي كهرباء - كشافات أماميه ليد متكيفه - سخانات بالكراسي - بارك سنسور أمامي وخلفي - كاميرا خلفيه - أوتو بارك - كراسي جلد. \nكاوتش وبطاريه ١٠ ألاف كيلو \nالسعر: ٨٥٠ ألف\nالمكان: مدينتي'),
('180078169', 'هوندا سيفيك ٢٠٠٨ للبيع استخدام بيتي فابريكا دواخل ورشه بالكامل من بره صيانه بانتظام واستخدام زيت وقطع غيار بالكامل من التوكيل الكشافات الفوانيس الاصليه VTi تحكم طارة ومالتي وزي ما واضح بالصور فيها رخصه سنه ونص مطلوب ٣٥٠ الف قابل للتفاوض البسيط عند التنفيذ الاتصال على رقم ٠١١١٢٤٠٢٥٥٧ واتس اب أو مكالمه'),
('181943825', 'Audi a3 حاله نادره ماشيه 60 الف كيلو فابريقه. فول ابشن اوتوماتيك فرش جلد شاشه.'),
('183727322', 'Very good condition\nSsangyong Tivoli - Grey - Sport line\nModel 2020\n81,000 KM'),
('184774301', 'رخصه نقل ساريه مرور قطور محافظه الغربيه حاله جيده, فبريكه دواخل عداد 280 الف كيلو متر. جلد اصلي مع فرش قماش ازرق ممتاز. طبليه صندوق من خشب سابرس.'),
('185657401', 'Mercedes GT 63  4 matic AMG\n- Engine : 4000 CC\n- M/Y : 2019\n- KILO METERS : 4200km\n\nPLATINUM AUTO \nFor more info : (View phone number)'),
('186226847', 'رينو فلوانس ٢٠١٥ كامله اسود فاميه معملوها صيانة ال ١٤٠ الف من ٤ ايام رشه جنبين نضافه وفيها رخصه سنتين'),
('187317314', 'دودج رام ٢٠٠٩ تعديلات ٢٠١٨ Rebel\nتعمل بسوفت ويير من Hp tuner\nهارد توب فتح وقفل هيدروليك\nكاسيت تيسلا\nللمزيد من التفاصيل  والمعاينه يرجي الاتصال او الارسال واتس آب في حاله وجود جديه. \nقابل للتفاوض بعد المعاينه. . . والمعاينه بالمقطم او التجمع او مدينه نصر حسب الاتفاق\nمتاح امكانيه التقسيط المباشر لدي بعض الشركات\nومتاح البدل بشقه في التجمع او المقطم او مدينه نصر'),
('187822602', '. سياره فورد فيستا تم شراءه في ٢٠٢٠ل\nHigh line . LED. Panoramic roof'),
('188103962', 'فورد كوجا الفئة الاولى فابريكا بالكامل موديل 2017 عداد 144 الف كيلومتر بها كاوتش جديد وبطارية جديده صيانة توكيل حاله نادره لا تحتاج اى مصاريف راشة شنطة'),
