('190670372', 'شيفروليه دبابة 2018 بوحدة تبريد كايروفوم بحالة ممتازة جدا\nباضافة بوحدة توصيل كهرباء من خارج السيارة \nكاوتش و بطارية جديد\nفابريكة بالكامل عدا رفرف و اكسدام و جزء بسيط جدا من الكبوت\nعداد 335 الف \nمطلوب 385 الف \nرجاء احضار فني في المعاينة لعدم اهدار الوقت\nت / 01005317489'),
