('191565886', 'السياره رخصه باسمي وكل الصيانات من الزيرو وحتي الان في توكيل الدقيsnaوكل التقارير الخاصه بالسياره داخل التوكيل والسياره فابريكه بالكامل بدون رش نهاءي ما عدا الاكصدام الامامي وتم رشه ومثبت بالتوكيل الدقي والسياره لا  تحتاج اي مصروفات والبيع للتحديث فقط والبيع بعقد مسجل واشكر الجميع في عدم الفصال بالتليفون والمعاينة بموعد مسبق بالشيراتون'),
