('192475900', 'MERCEDES A35\n2022\ndeposite 780000'),
('192499135', 'كيا سبورتاج اعلى فئه 2018 بالضمان حاله الزيرو + بوليسه تأمين GT LINE جميع الصيانات بالتوكيل حتى اخر صيانه فرش جلد طبيعى + زجاج فاميه + ليدات اماميه وخلفيه + شنطه كهرباء + جنط 19 + 9 ايرباج + بصمه خارجيه وداخليه + 2 كرسى كهرباء + 4×4 + شفتات طاره + بانوراما + كاميرا + حساسات خلفيه واماميه\nملحوظه هامه \nالسياره بحاله الفابريكه 57000 كيلو\nالسياره كأنها لم تستخدم\nللأتصال\n01004430122\nمطلوب 910000\nالمعاينه مصر الجديده'),
('192722794', 'تويوتا كورولا مو ٢٠٠٧\n١٦٠٠ سي سي\nعداد ٢٢٠٠٠٠ كم\nمغيرة شنطة بالكامل \nمالك اول من الزيرو \nجميع الصيانات بالتوكيل حتى آخر صيانة \nمطلوب ٣٧٠،٠٠٠جنية\n٠١١١٧٧٣٣٣٠٠\n٠١١٤٩٠٢٠٩٤٦'),
('192984439', 'كورولا ياباني مواصفات خليجي فابريكا داخل وخارج لم ترش بعض الخرابيش البسيطه في الاكصدامات والفوانيس مالك اول رخصه سنتان. ممنوع علي التجار.'),
('193127431', 'Jaguar I-pace  \n2022\n1000km\n400hp\nAcceleration 0-100km/h 4.8 second \nup to 446km\nWARRANTY: 8 YEARS from MTI \nLED headlights\n20\" Styles \nLuxtec sport seats\nLeather steering wheel\nPremium LED headlights with signature DRL\n20\" Style 60072 wheels\nDuoLeather sport seats\nPowered tailgate\nHeated, electric, power fold, memory door mirrors with approach lights and auto-dimming driver side\nتسليم فوري بضمان الوكيل'),
