('195067224', 'هيونداي توسان ٢٠٢١ الفئه الخامسه أعلى فئه الشكل الجديد الجيل الرابع NX4e. \n\n- (٩) فروقات بين الفئه الرابعه والخامسه\n\nاولا. . . فتح وغلق الشنطه كهرباء بزر من الشنطه أو من داخل السياره. \n\nثانيا. . . قياده ذاتيه وتحديد عدم خروج من المسار اوتوماتيك من العربيه نفسها أو ظبطها من اعدادات الجهاز لتعطي تحذير صوتي فقط. \n\nثالثا. . . استشعار الجسم الي امامك واختيار أنها تفرمل لوحدها لو انت مفرملتش أو تختار أنها تعطي تحذير فقط. \n\nرابعا. . . ٤ كاميرات زياده للرؤيه ٣٦٠ درجه. \n\nخامسا. . . لما تيجي تدي اشاره يمين العداد بتاع الامبير الي قدامك بيفتح كاميرا الجانبيه يمين ولما تيجي تدي اشاره شمال العداد بتاع السرعه الي قدامك بيفتح كاميرا الجانبيه لشمال العربيه. \n\nسادسا. . . الكرسيين الي قدام كهرباء. \n\nسابعا. . . في تبريد للكرسيين الي قدام. \n\nثامنا. . . . النقطه العمياء في المرايات وقدامك في لوحه العدادات. \n\nتاسعا. . . التدعيم القطني للظهر من أسفل لكرسي السائق. \n\n::: وما يلي اضافات تم عملها تمنها فوق ال (٢٥,٠٠٠ جنيه) حاليا والسعر دا طبعا داخل ضمن سعر البيع المعروض ولكن لزم التنويه :::\n\n١- افلام حمايه امريكي 3M بنسبه 90٪ لكل الزجاج بالضمان من CGN Center (٥,٠٠٠ جنيه). \n\n٢- الضمان ٧ سنين مش ٥ سنين او ١٥٠,٠٠٠ كم مش ١٠٠,٠٠٠ كم (١٠,٠٠٠ جنيه). \n\n٣- الرخصه بها سنه ونص كمان حتى يونيو ٢٠٢٤ انشاء الله (٥,٠٠٠ جنيه). \n\nودول كدا  ب (٥,٠٠٠ جنيه)\n\n٤- دواسات 5D . \n\n٥- دواسات هيونداي. \n\n٦- دواسه للشنطه. \n\n٧- عدد2 جراب للريموت واحد فيبر كاربون والتاني بلاستيك معالج ضد الجروح. \n\n٨- شنطه ماركه هيونداي للشنطه الخلفيه لتجميع كل اللوازم. \n\n٩- منفاخ العجل. \n\n١٠- قفل دريكسيون. \n\n١١- كوفر دريكسيون . \n\n١٢- مكنسه يد. \n\n١٣- يوجد لل 4 ابواب والبربريز الخلفي (sunshield) متحرك للحمايه الداخليه للعربيه من الشمس المباشره. \n\n١٤- كوفر القمامه متحرك من الووتر بروف مصمم للعربيه. \n\n١٥- عدد 2 كوفر جلد ماركه هيونداي لوضع المناديل الورقيه داخلهم. \n\n١٦- قطره لوقت الإنقاذ. \n\n١٧- وصله بطاريه. \n\nالمجموع توتال ٢٥,٠٠٠ جنيه داخلين طبعا في سعر البيع الي انا عارضه بيه لكن لزم التنويه. \n\n- الاستبن والكوريك لم يستخدم. \n\n- وطبعا من وقت الترخيص لسه موجود الطفايه والمثلث والقمع وكله جديد لم يستخدم. \n\n- صيانه الالف في التوكيل والفاتوره موجوده. \n\n- صيانه ال ١٠,٠٠٠ في التوكيل والفاتوره. \n\n- العربيه داخله على  ١٥,٧٠٠ كم.'),
