('195808562', '***** برجاء التواصل وتس فقط  ******\nللبيع ميتسبوشي (ياباني بالكامل) باجيرو دفع رباعي 4x4 موديل 99 مجهزة بالكامل لرحلات السفاري بحالة ممتازة فتيس اوتوماتك  وفتيس غرز شغال زجاج كهربه مرايات كهربه باور سنتر لوك ووحدة رفع وجهاز انذار ضد السرقة 4 ارباج تكيف ثلاجة فرامل Abs كاسيت Usb و Aux انوار ليد بالكامل واطي وعالي + شبورة فرش جلد الماني\nموتور 1600cc سلندر 4 ماشيه 209 الف كم (صيانات منتظمة) امكانية القيادة بالدفع الرباعي او بالدفع الخلفي فقط امكانية طي الكنبة الخلفية لتوفير مساحة اكبر للشنطة \n\n** حالة السيارة للمستخدم ممتازة بدون اي مشاكل استعمال راقي رخصة سارية 6 شهور مرور القاهرة وبالنسبة لقطع الغيار متوفرة وباسعار معقولة (نفس قطع لانسر بومة) \n \n** السعر 200000 الف جنيه (كاش غير قابل للتقسيط او البدل) قابل للتفاوض البسيط فحالة الجدية فقط بالشراء. \n\n** برجاء التواصل   {{{( وتس فقط }}})   للجادين في الشراء فقط 01000040412 حفاظا على وقت الجميع المعاينة بالتجمع الخامس ويفضل احضار فني للكشف عن حالة السيارة لضيق الوقت'),
