('195811115', 'MG  ZS   2020   TOP LINE\nصيانات توكيل            Only  60000km     \n بارخص سعر ف مصر \nجميع الكماليات . 4ايرباج . Start engen .  بصمه  . فرش جلد .  مثبت سرعه . TRC . EBD . ABS  . تكييف . باور ستيرينج . سنتر لوك . حساسات نور ومطر . USB . AUX . Bloutoth.  زجاج ومرايات كهرباء . زجاج ملون . مرايات ضم . جنوط سبور ١٩ . ليد امامى . ليد خلفي . كاوتش جديد . كرسي كهرباء . اشارات مرايات . سنسور بارك امامى وخلفي . مرايا تعتيم . كاميرا خلفية  . فبريكة بالكامل بحالة المصنع .   \n بدون ملحوظه ولا خربوش  \n   السعر / 535000. \n للاستعلام برجاء الاتصال على ارقامنا /\n‪+20 115 225 7749‬ $'),
