('195811320', 'سيارة بي واي دي  ، أزرق بيبسي ، موديل ٢٠٢١ ماشية ١١٣٠٠٠ كيلو قابلين للزيادة بسبب السفر أسبوعيا للإسكندرية ، أنا المالك الاول من الزيرو ، السيارة تعمل بالبنزين والغاز الطبيعي والغاز خالص . \nجميع الصيانات في التوكيل بالفواتير كلها من الزيرو الى صيانة ١١٠ الف كيلو . \nليس بها أي حوادث وليس بها جرام بوية غير بوية المصنع ، معايا ٢ مفتاح بالريموت والكتالوج . \nفيها ٢ إيرباج و فرامل ABS و EBD و ٤ زجاج كهرباء وفرش جلد ، بطارية جديدة في الضمان و ٤ فرد كاوتش جديد ، معاها شبكة ألومنيوم فوق السقف و الإستبن جنط لم يلمس الأرض . \nالتكييف زي الثلاجة ما شاء الله . \nوالعربية متأمن عليها تأمين شامل ضد الحوادث بإسمي من شهر ١١ الماضي . \nالسيارة فيها رخصة لحد شهر ١١ / ٢٠٢٣ . \nالبيع بسبب الحاجة لشراء سيارة أتوماتيك بسبب تعب في قدمي اليسرى فقط ولولا ذلك السبب لم أفكر في بيعها أبدا . \nمطلوب ٣١٠ الف جنيه قابل للتفاوض عند توفر الجدية . \nمستعد للكشف على السيارة في التوكيل أو في أي مكان تاني . \nالسيارة موفرة جدا وللعلم بسافر لحد إسكندرية من القاهرة ب ٤٥ جنيه غاز . \nربنا يبارك لمن تكون هذه السيارة من نصيبه .'),
