('196002271', 'عربيتي الخاصة بيتي كسر  زيرو استعمال راقي .   للتواصل ،01100760746.01092499430\n\nنيسان صني موديل 2020 فبريكة بره وجوه من الاكصدام للاكصدام ولا غرام بويه. \n \nببيع عربيتي الخاصة نيسان صني جديده موديل 2020حالة نادرة فبريكة بره وجوه من الاكصدام للاكصدام والمعاينة خير دليل\n\nالعربية تحفه ممتازه استعمال خفيف جدا ومحافظ على العربية. \n\nبقالها معايا سنة ،العربية اقتصادية جدا جدا في البنزين. \n\nزيت وفلتر جديد من شهر، وبطارية جديدة من 3 شهور. \n\nرخصه سنتين ونص، الرخصة باسمي. \n\nعداد العربية 43700 كم يعني لسه جديده. \n\nبرجاء التجار يمتنعون نهائي. \n\nالمطلوب 365000 السعر قابل للتفاوض البسيط جدا جدا ،برجاء بعد المعاينة وليس في التلفون  . \n\nالمعاينة مكرم عبيد مدينه نصر برجاء إحضار فني لضيق الوقت.'),
