('196048546', 'سيارة رينو لوجان فئة آولى اوتوماتيك، حالة الجديدة، مرفوعة ٤ سنوات ويتم عمل الصيانات الدورية وتغيير الزيوت ورفعها في كل سنة، ممشى ٢٥٠٠٠ كم طرق سريعة (سفر)\nالسيارة كانت مغطاة والغسيل بمنتجات مستوردة للحفاظ على جودة الدهان والحماية من الخدوش. \n\nالحالة كما موضح بالصور، والمطلوب نهائي ٣٨٠،٠٠٠ علماً ان نفس السيارة بالفئة سعرها اليوم ٤٥٠،٠٠٠\nسبب البيع توفر سيارة اخرى من قبل العمل، وعدم الاحتياج اليها. \n\nارجو الاتصال من الجادين فقط والسعر نهائي.'),
