('196204951', 'للجادين فقط و هواة السيارات المميزة، سياره الرئاسه الفرنسيه دي اس ٧ اوبرا ٢٠١٩ لون نحاسي مميز و نادر جدا في مصر بحاله الفبريكه عداد ١٧،٠٠٠  عليها طبقه حمايه كامله، استخدام خفيف بسبب السفر ، صيانه دوريه في التوكيل مع الضمان ، \nفل اوبشن شامل تسخين و تبريد الكراسي، مساج، رؤيه ليليه، سبع انماط سواقه، منها نمط الراحه عن طريق قراءة الطريق لتعديل نظام التعليق لراحه اكثر، ونمط السبورت يتغير معها نظام التعليق و الدركسيون و العادم لنظام الباور لقياده امنه و قوية و ممتعه، امكانيه تغير شكل و لون العدادات، جميع وسائل الامان، نظام الرؤيه الليليه بالاشعه تظهر في شاشه العدادات لرؤية اي شخص او حركه امامك في الظلام و تنبيهك، اضائة ليليه داخليه مع امكانيه تغيير الالوان، تطبيق خاص للسياره يجعلك تتابع صرف الوقود و التكلفه و حفظ و تراقب حركه السياره لحظح بلحظه طوال الوقت مع تحديد وقت وتاريخ و موقع الانطلاق و الوصول لكل مشوار تم بها، نطام النفيجيشن مع الخرائط المحدثه لمصر.'),
