('196327920', 'سيات اتيكا ثاني فئة عداد 16 الف موديل 22 فابريكا بالكامل\n\nخليك فى المضمون مع اوتو 4 يو انت دايما كسبان \nارخص من ارخص سعر فى مصر \nاقل مقدم 25% \nاطول فتره سداد  حتي 7 سنوات \nتقسيط مباشر \nافضل خدمه تامين وخدمات ما بعد البيع \nللاستفسار زورونا فى 21 محمد يوسف موسي من عباس العقاد مدينة نصر القاهره\n01097010007\n01026697964\n01013193500\n01117007849'),
('196327990', 'اسبرانزا 2007 مرور القاهره اللي على الكورنيش فابريكا من الاكصدام للاكصدام كما موضح في الصور السعر النهائي فيها رخصه سنه الا شهرين فابريكا بوهيه المصنع كما موضح الخرابيش في الصور فابريكه من الاكصدام للاكصدام المعاينه مصر الجديده'),
