('196328151', 'عربيه لافيتا 2005فابريكا بره وجوا جنوت اسبور كست بلتوس العنوان حلميه الزيتون بجوار كنتاكي  رقم الفون 01032662687 العربيه 2005مريات ضم'),
('196328238', 'السيارة مالك اول من الزيرو يوجد بعض الدهانات الخارجية للنظافة السيارة كاوتش جديد بطارية جديدة مرور مدينة نصر/اعلي فئة ماعدا بصمة وفتحة السقف قابل للبدل بسيارة ام حي rx5 اعلي فئة\nالسعر قابل للتفاوض للجادين فقط بعد المعاينة'),
