('196372475', 'تيجو 7 برو أعلي فئه كسر الزيرو\nموديل 2022 / عداد 30.000 كم\nصيانات توكيل / رخصه سنتين و نص\nفابريكا بالكامل عدا اكصدام امامي نضافه\nطبقه حمايه بالكامل تمنها 35 الف لسه فالضمان\nعازل حراري للزجاج بالكامل\nاستبن لم يستخدم منزلش الأرض\nالسعر قابل للتفاوض عند الجديه و سرعه التنفيذ\nالمعاينه بشيراتون المطار مصر الجديده او مدينتي حسب التواجد. . \n\n01111800073 عمرو'),
('196372660', 'GOLF 6 \nتم تغير رفرف خلفي شمال و رشه باب و اكصدام خلفي \n161000km\n2011'),
('196372732', 'امكانيه التقسيط \nذوى الاحتياجات \nسعرها 16,890 دولارالسعر يشمل الجواب والترخيص والجمارك\nمتاحه في القاهرة للمعاينه \nللتواصل على 01124562931او01110555136او01148544456 او الرقم الارضي 0225787129\nالكماليات والرفاهية الخاصة بالسيارة:\n\nمقود كهربائي: هذا المقود افضل من المقود الهيدروليكي حيث انه يعمل بنظام التوجيه بموتور كهربائى صغير مثبت تحت عجلة القيادة فهو يوفر العديد من المزايا مثل: \nنعومة وسلاسة فى ركن السيارة. \nقدرة عالية ومرونة أثناء المناورة علي سرعات عالية. \nلا يحتاج إلى أي صيانة دورية منتظمة. \nبلوتوث: يمكنك من اقتران الهاتف بالسيارة للرد على المكالمات و تشغيل الوسائط في السيارة. \nاعدادات التحكم في الصوت من خلال عجلة القيادة: يمكنك التحكم في مستوي الصوت بالسيارة من خلال عجلة القيادة داخل السيارة مما يرفع مستويات الأمان أثناء القيادة حيث يمكنك القيام بخفض أو رفع الصوت بدون الانشغال عن الطريق. \nمدخل AUX: حيث يمكنك من خلال هذا المخرج توصيل الهواتف مشغلات الملفات الصوتية التي ليس بها بلوتوث بالسيارة والاستماع للملفات الصوتية بجودة عالية. \nمشغل اسطوانات CD: حيث يمكنك من خلال هذه الميزة الاستماع لملفات الصوت المختلفة والمخزنة على الاسطوانات المدمجة. \nمدخل USB: تحتوي السيارة على مدخل USB حيث يمكنك من خلاله توصيل الهاتف الخلوي لإعادة شحنه. \nأقفال آلية للأبواب: بعد السير بالسيارة يتم اغلاق جميع الابواب أوتوماتيكيا. \n6 مكبرات الصوت: تمتلك السيارة 6 مكبرات للصوت لتوزيع الصوت بأفضل شكل ممكن داخل السيارة او في الخلف. \nنظام ملاحة: وهو نظام ملاحة عبر الأقمار الصناعية مصمم خصيصاً للسيارات، وتعمل أنظمة الملاحة داخل السيارة لمعرفة موقع السيارة، كما تسهل على السائق معرفة الطرق وكيفية السير للمكان المطلوب. \nعجلة القيادة كهربائية: عجلة القيادة كهربائية و مدمجة بـ شاشة الراديو الملونة المتواجدة بمنتصف التابلوه. \nزر مثبت سرعة: زر خاص على عجلة القيادة يمكنك من خلاله تثبيت سرعة السيارة مباشرة. \nزر تشغيل السيارة: يمكنك تشغيل السيارة بزر خاص بداخلها دون الحاجة للمفتاح الخاص بالسيارة. \nشاشة عرض المعلومات: السيارة بها شاشة مخصصة لعرض المعلومات المتعددة عن كل شئ في السيارة والتي تساعد السائق في معرفة جميع الأشياء عن السيارة. \nتحكم كهربائي بالمقاعد: تمتلك السيارة إمكانية  التحكم الكهربائي بالمقاعد عن طريق ازرار مجهزة للتحكم في المقاعد و تقديم المقعد أو تأخيره دون الحاجة للنظام القديم المزعج. \nتعديل ميل عجلة القيادة: يمكن للسائق التحكم في ميل وحركة عجلة القيادة على حسب طول قامة السائق. \nفتح السيارة عن بعد بواسطة ريموت السيارة. \nحساسات أمامية و خلفية: السيارة تتمتع بوجود حساسات تساعد في الاصطفاف مع وجود كاميرات في السيارة للاصطفاف. \nمسّاحات مطر اوتوماتيكية: السيارة بها مساحات مطر تعمل اوتوماتيكياً في حالة وجود ماء او امطار، دون الحاجه من السائق في التدخل لتشغيل المساحات. \nمماسك الأكواب. \nمرايا الباب إلكترونية. \nالكنسولة المركزية كبيرة و تتسع للمجلدات أو الأوراق الهامة. \nعداد المسافة. \nحامل أكواب أمامي. \nمشغل اسطوانات. \nالتحكم فى المقعد أوتوماتك. \nتعديل ميل عجلة القيادة. \nزجاج كهربائى امامى و خلفى. \nمصابيح ضباب أمامية فقط. \nطي المرايات كهربائياً. \nمشغل CD، MP3، راديو. \nحساسات خلفية. \nعجلة القيادة من الجلد. \nحامل النظارات الشمسية فوق الرأس. \nجيوب خلفية. \nمقاعد خلفية قابلة للطى. \nمزيل ضباب خلفى. \nمكيف أوتوماتيك. \nمصابيح أمامية أوتوماتيكية. \nمساحات للمصابيح الأمامية. \nضوء في الصندوق الخلفي. \nمصابيح أرضية. \nعادم مزدوج. \nعرض المعلومات المتعددة. \nجنوط من الخليط المعدني. \nدواسات رياضية. \nمصابيح انعطافات. \nمقاعد من الجلد.'),
