('196374536', 'لعشاق الألماني\nسياره أوبل جراند لاند بدون خربوش أعلي فئه توب لاين جميع الكماليات موديل 2018 عداد 80 ألف كيلو فابريكة بالكامل برا وجوا السياره جديده لانج جميع الصيانات معموله بانتظام ف التوكيل بل فواتير و الكتلوجات لحد اخر كيلو يوجد بها جميع الكماليات\nسقف بانوراما . . مفتاح بصمه . . جنوط اسبور لونين . . سنسور برك أمامي وخلفي . . ليد نهاري أمامي وخلفي . . 8 أير باج . . فرامل ABS . . ABD . . نظام مانع تزحلق . . مثبت ومحدد سرعه . . طاره مالتي فاكشن كامله . . فرامل كهرباء . . شنطه كهرباء . . شاشة تعمل باللمس . . بلوتوث تليفون . . كاميرا خلفيه . . كراسي كهرباء . . و العديد من الكماليات\nواستخدم أول مالك من الزيرو حاله بسم الله ماشاءالله تبارك الله'),
