('196375610', 'ميني كوبر موديل ٢٠١٦ 5 doors اللون ابيض لؤلؤي حاله الزيرووو. \nعداد ٨٥٠٠٠ كيلو معمول كل الصيانات. \nفابريقه بالكامل بدون اي جرام بوهيه باي مكان من الداخل او الخارج. . ولا يوجد بها اي خرابيش. \nاعلي فئه luxury . . بانوراما . . مثبت سرعه. . مالتي. . مزوده باوبشن بالفتيس اختيار الجرين( economy) اوالميديام اوالاسبورت . . فرش جلد. . آي درايف. . امباينت لايت. . عدسات امامي ليد اصلي واطي وعالي وشبوره. . سينسور بارك. . استارت انجن. \nفوانيس خلفي union jack. \nكاوتش جديد ماشي ٢٠٠٠ كيلو فقط. \nبطاريه جديده. \nلا يوجد بها اي اعطال ولا تحتاج لاي مصاريف. \nالسعر قابل للتفاوض البسيط بعد المعاينه والكشف وابداء الجديه للشراء. \nالمعاينه المقطم او مدينه نصر. \nبرجاء التواصل في حاله الجديه فقط منعا لضياع الوقت. \n٠١٢٨٩٢٩٩٩١١\n٠١٠٠٥٥٢٥٣٠٢'),
