('196428603', 'سيات ليون فابرييكا دواخل وسقف وكبوت وشنطه والسعر نهاءي والعايز يفاصل ميتصلش والمعامله في العبور يوميا من الساعه ٥ الي ١٠ فرامل abs و ٤ اير باج الماتور ماشي ٢٥٠ واي مصروف علي العربيه هيتخصم من تمنها'),
