('196428613', 'باسات موديل ٢٠١٨ كامله بدون فتحة سقف\nفبريكه بالكامل عدا اكصدام خلفى\n١٢٦،٠٠٠ كيلو\nصالون كهرباء ومساج بالكامل الكرسيين\nكاسيت R\nليد واطى وعالى\nمرايات ضم كهرباء\nمراية صالون فريمليس تعتيم\nجنوط ١٦ وكاوتش ميشلان ٢٠٢١\nكاميرا خلفيه\nسينسور امامى وخلفى\nسبويلر خلفي\nزجاج فيميه جانبى وخلفى مثبوت\nمرور مدينة نصر\nكل حاجه تعمل ولا تحتاج لاى مصروف\nالمعاينه في الشروق \n٠١٠٠٣١٣٢٢٩٤'),
