('196428929', 'النترا CN7 2021 فابريكة بالكامل الفئة الخامسة بصمة خارجية وداخلية   فتحة سقف \nمفتاح دواره عن بعد \nليد كامل امامي وخلفي \nجنوط  شاحن wire less \nجميع الكماليات حساسات امامي و خلفي \nكاميرا جنوط سبور عداد ديجيتال مالتي فانكشن \n‏رخصة سنة مرور النزهة   56,000 كيلومتر \n‏المعاينة زهراء المعادي \n01270556462\nالسعر.  (790)'),
('196428934', 'جيلي ام جراند 7 2014'),
('196429080', 'السيارة هي الوحيدة حتي الان في مصر كيا كارنز الشكل الجديد توب لاين الموتور التربو ١٦٠ حصان ضمان الوكيل وليست مستورده كماليات لا حصر لها سبع مقاعد راحة في كل كرسي غير مسبوقه استهلاك بنزين اقتصادي جدا السيارة هي تحفه فنيه لمن يرغب في شراء سيارة مريحة كبيرة اقتصادية سيارة لها تاريخ في العالم من ٢٠٠٨ بنجاحات ساحقة السيارة زيرو بمعني الكلمة رخصة سنة المعاينة بالزمالك او المهندسين'),
