('196474650', 'للبيع بي ام دبليو موديل ٢٠١٥ فيس ليفت ( مالك اول من الزيرو)\nاعلي فئه s drive \nماشيه ١١٨ الف كيلو فقط ( موتور- فتيس- عفشه) حاله ممتازه جدا \nفبريكا بالكامل من الداخل- رشه خارجي معدا السقف للتجديد بدون خبطات نهائي \nجميع الكماليات ( بصمه - فتحه سقف بانوراما- I drive-مرايات ضم- جنوط اسبور ١٨- طاره مالتي- مثبت ومحدد سرعه- كراسي اسبورت - تكيف تاتش- وحده رفع- سينسور بارك- صالون جلد طبيعي حاله ممتازه-روف راك - ٨ ايرباج - ABS - EBD - مانع تزحلق- فوج لايت - اوتو لايت - Bluetooth system )\nرخصه ساريه ١ عام مرور الجزيره \nجميع مشتملات السياره موجوده - كتالوجات \nالمعاينه في مدينه نصر يوميا بتليفون سابق'),
('196474704', 'أدفع ٩٥٠٠٠ وأستلم إم چي 5 ٢٠٢٢ تاني فئة كمفورت  فابريكة بالكامل \n\nفابريكة بالكامل بدون خربوش بحالة الزيرو تماما \nرخصة سنة \nبدون إجراءات بنكية وبدون تامين اجباري  \nوأستلام خلال ٧٢ساعة \nبمقدم يبدأ من ٢٠٪؜ وتقسيط حتي خمسة سنوات \nسعر الكاش = ٤٦٥٠٠٠ \nحالة السيارة : فابريكة بالكامل من الخارج والداخل حتي الاكصدامات\nالعداد : ١٧٠٠٠كيلو متر صيانات توكيل \nالكماليات : تاني فئة كمفورت  \nعنوان المعرض : ٦٥ ش الناصر كوبري القبة خلف وزاره الدفاع \nمواعيد الاتصال والمعاينة : من الساعة ٢م حتي ١١م \nملحوظة : خصم خاص لسعر الكاش\nيمكن التقسيط المباشر مع المعرض بمقدم ٣٠٪؜ وتقسيط حتي اربعة سنوات \nبصورة البطاقة فقط'),
