('196512433', 'كيا سيراتو 2015 . الشكل الجديد K3\nالفئة الأولى . جنوط كامله والاستبن جنط. طارة مالتي. ليد امامي. فرش كراسي وكنبةوأرضية دواسات 9D عمولة. معمولة صيانة كاملة من 15 يوم. شاشة اندرويد 9 بوصة وكاميرا خلفية وحساسات خلفية. \nراشة من الخارج بدون السقف والشنطة والكابوت. كان موجود حادث بالرفرف اليمين خلفي وتم اصلاحه. ماتور وفتيس ممتاز. عداد 143 الف كيلو شرعي. \nالسعر النهائي 400 الف جنيه . \nالتواصل على الواتساب فقط. \n01212719042\nللجادين فقط. برجاء احضار الفني مع حضرتك لعدم ضياع الوقت. التحرك فقط على الشهر العقاري للتسجيل. \nالمعاينة. القاهرة. شبرا مصر \nحالة العربية كما موضح بالصور. \nانتهاء الترخيص شهر مايو المقبل. الرخصة ب اسمي. \nكل التفاصيل كامله بالاعلان.'),
