('196546333', 'نيسان صني 2018 أتوماتيك فابريكا بالكامل متاح تقسيط'),
('196546432', 'شيفروليه لانوس 2012 بحالة ممتازه فبريكا دواخل بالكامل بدون اي خبطات ولا ملاحظات وفبريكا سقف وشنطه وكبوت بدون ملاحظات وراشه جنبين فقط السياره ليس بها اي حوادث او ملاحظات موتور بحالة فوق الممتازه ولا يحتاج اي مصروف نهااائي وتم عمل جميع الصيانات والسيرفيس ولا تحتاج لتغيير اي شئ بمعني الكلمه والعفشه بحاله جيده والفرش الاصلي الفبريكا وحالته ممتازه بدون خدش\nعداد 153000 كيلو\nرخصه سنه مرور بنها\nفاميه خلفي وجانبي الفبريكا \nطقم ليد زينون عالي وواطي وطقم فوجات شبوره زينون \nتسجيل بلوتوث جديد دبل بيز بالضمان واربع سماعات بحاله ممتازه\n4 زجاج كهرباء و وحدة رفع زجاج \nجهاز انذار وسنتر wolf اصلي وريموت \nبطارية جديده وكاوتش انتاج 2021 بحاله ممتازه كلهم نفس النوع \nشبكه اماميه شرائح كربون اصليه ورموش فوانيس كربون\nجراب الدركسيون مومو اصلي ومخدع يد علي الكونسول جلد \nكوريك تمساح وصليبه جداد لم يستخدموا نهائي وطقم شماسات مطر\nالعربية مصروف عليها كتير ومش محتاجه مصروف وهتركب وتمشي بدون مبالغه'),
('196546632', 'رينو لوجان فبريكة بالكامل جوة وبرة \nصالون بحالة الزيرو \nماشية 42000 كم فقط \nصيانة توكيل ومركز خدمة \nرخصةسارية الى 2 /2023 ويمكن دها سنة اضافية على حساب المشترى \nعفشة والات جر زيرو \nمكنة وتكييف زيرو \nزجاج امامى كهربا وخلفى مانيوال\nحالة الكوتش ممتازة والاستبن لم يستخدم \nالصور واضحة جداا\nالاتصال للجادين'),
