('196548316', 'اوتوبارك . . . . من المالك الاول ليك\nستروين c4 جراند بيكاسو ( 7 راكب )\nموديل 2018\n عداد 110,000 كم \nفبريكا بالكامل\nرخصة باسم المالك مباشرا \nالمواصفات الفنيه:\nموتور 1600  - 165 حصان - ناقل حركه اوتوماتيك 6 سرعات - متوسط استهلاك الوقود 6.7 لتر لكل ١٠٠ كم  \nالكماليات: \nتكيف dual zone  -  فرش جلد  - قفل مركزي  - مقاعد خلفية قابلة للطي  - زجاج كهربائي  - مرايات ضم كهرباء  - جنوط اسبور  - حساسات ركن خلفية  - مفتاح بصمه start engine - طارة مالتي فانكشن - مثبت سرعة - محدد سرعة - شاشة مزودة ب(USB - AUX - bluetooth) - كمبيوتر رحلات - كمبيوتر اعطال - فرامل يد كهرباء - مرايه داخليه بخاصيه التعتيم الذاتي - مسند يد امامي - فامية للابواب الخلفية - سماعات بالابواب - التحكم في ارتفاع كرسي السائق - طارة متحركة متعددة الاوضاع - كاميرة خلفية - مساحات تخزين في الابواب - مصابيح ضباب - مصابيع امامية و خلفيه ليد\nتجهيزات السلامة والأمان:\nانظمه AIRBAG لكل من السائق و الركاب \nانظمه الفرامل ABS - EBD - ESP\nبرنامج تدعيم الفرامل\nالسعر : 650.000 جنيه \n كما يتوفر لدينا انظمه تقسيط متعدده تناسب جميع الفئات ( بنوك - شركات تمويل - مباشر )  \nبمده تقسيط تصل إلى ٦٠ شهر \nاتصل بينا واعرف نظام التقسيط اللي يناسبك \n و ممكن تبدل عربيتك القديمه بعربيه جديده و تقسط الفرق \nملحوظه هامه : اطلب تطلع علي كل مستندات السياره و الفحص الفني لحاله السياره قبل ماتدفع أي أموال أو حتي قبل ما تقوم بفحصها بمعرفتك\nجميع السيارات المعروضه تم التحقق من سلامه ملكيتها لملاكها وتم عمل فحص فني باحدث الاجهزه علي يد متخصصين بخبره أكثر من ١٠ سنوات في فحص السيارات'),
('196548424', 'شيفروليه اوبترا ٢٠٠٧ اوتوماتيك مواصفات خليجي كامله اسبورت هوك وديفيل امريكى وفوجات وحساسات ركن ووحدة رفع للزجاج فابريكا بالكامل ماعدا حزام للنظافه وماشيه ١٤٨ الف كم والرخصه باسمى سنتين مرور المعادى ولسه مغير اربع فرد كاوتش جداد وبطاريه جديده والعفشه لسه مغيرها كلها والماتور و الفتيس ولا كلمه بفضل الله وجميع الكماليات تعمل بكفاءة ومتاح الكشف في اى مكان معتمد بعد الاتفاق وعند الجديه'),
