('196549275', 'بسم الله الرحمن الرحيم\nلعشاق الفابريكا و الكسر زيرو\nأم جي ZS موديل 2022 تاني فئه بصمه بدون خربوش عداد 9000 كم بس صيانه ف التوكيل بل فواتير و الكتلوجات حاله بسم الله ماشاءالله تبارك الله زيرو بحاله المصنع واستخدام أول مالك من الزيرو السياره بفضل الله فابريكة بالكامل برا وجوا بدون أي دهانات نهائي كسر كسر زيرو بمعنى الكلمة استبن زيرو لم يستخدم نهائي السياره بدون ملحوظه استعمال بيتي زيرو فعلاً'),
